'DeleteCookiesDesc'=>'Jeżeli jest zaznaczona, system kasuje cookie po sprzedaży/przekierowaniu. Oznacza to, że Partner otrzyma tylko jednorazową prowizje, a wynagrodzenie z późniejszych zakupów klienta nie będzie naliczane (chyba, ze klient znowu zostanie przekierowany przez link partnerski). Domyślnie plik cookie jest usuwany i Partner nie otrzyma prowizji od wszystkich przyszłych zamówień klienta.',
'OverwriteCookiesDesc'=>'Gdy użytkownik kliknie na baner partnerski, informacja na ten temat zostanie zapisana w pliku cookie. Jeżeli później odwiedzający kliknie na baner innego partnera, system może zastąpić bądź zostawić poprzednie cookie. Jeżeli plik cookie zostanie zastąpiony, a następne przekierowanie klienta nastąpi poprzez klikniecie linku Partnera, którego cookie zastąpiło poprzednie, to on otrzyma prowizje. Jeżeli nie jest nadpisane, prowizje otrzyma Partner, którego link jako pierwszy spowodował przekierowanie klienta, a przekierowania wynikające z linków innych Partnerów nie będą rejestrowane.',
